import React, { Component } from "react";
import data from "./data.json";

function Movie({ match }) {
  const movie = data.find((a) => a.slug === match.params.title);
  console.log(movie);
  return (
    <div className="Movie">
      <h2>{movie.name}</h2>
      <h2></h2>
    </div>
  );
}

export default Movie;
